import React from 'react'
import './Main.css'
import img from '../img/짭쥐 표지-18_cut.png'
import icon1 from '../img/map.png';
import icon2 from '../img/book.png';
import icon3 from '../img/clothes.png';
import icon4 from '../img/cooking.png';
import icon5 from '../img/news.png';

const Main = () => {

  const back = {
    display: 'flex',
    justifyContent: 'center',
    bottom:0,
    width:'100vw',
    height:'20vw',
    backgroundColor:'#3e448b'
  }

  return (
    <div>
      <div style={back}>
        <img src={img} style={{width:'90%', height:'90%'}}/>
      </div>
      {/* 아이콘 페이지 */}
      <div className='iconCon'>
          <img className='icon a' src={icon1}/>
          <img className='icon b' src={icon2}/>
          <img className='icon c' src={icon3}/>
          <img className='icon d' src={icon4}/>
          <img className='icon e' src={icon5}/>
      </div>
    </div>
  )
}

export default Main
